<div class="navbox">
    <div class="nav" style="background:#16d2de;">
        <ul class="zcenter" id="menuid"></ul>
    </div>
</div>
<script type="text/javascript">
    var lh = "GlobalSearch.html";
    var lu = location.pathname;
    lu = lu.substring(lu.lastIndexOf("/"));
    var tmp = '';
    if (lu !== "/SubIndex.html") {
        tmp = '../';
        $('.index-url').attr('href', '../index.html');
        // $('.sub-logo').attr('src', '../images/sub_logos.png');
        lh = "../GlobalSearch.html"
    }

    function GlobalSearch() {
        var content = $("#searchid").val();
        SetLocal("SearchContent", content);
        window.open(lh, "_blank");
    }

    function getUrl() {
        return window.location.search.substring(1).split('&');
    }

    var type = CustomDecode(getUrl()[0].substring(5));
    // console.log(type);
    SetLocal("SubType", type);
    $(".tao").html(type);

    function ToThings(obj) {
        var type = $(obj).text().trim();
        SetLocal("SubIndexType", type);
        location.href = "InternetThings/ThingsList.html"
    }

    // 声明网页位置标识
    var $sub_area_id = getUrl()[2].substring(3);
    // console.log($sub_area_id);
    $(function () {
        var murl = LoadUrl() + "axis2/services/MyService/getAreaMenuName";
        $.ajax({
            type: "POST",
            url: murl,
            data: {},
            dataType: "text",
            contentType: "text/xml",
            success: function (result) {
                result = loadXML(result);
                result = jQuery.parseJSON(result);
                // console.log(result);
                var html_home = '<li class="' + (($sub_area_id == '-1') ? 'current' : '') + '" id="-1"><a href="' + tmp + 'SubIndex.html' + '?area=' + CustomEnCode(type) + '&submenu=' + '&id=-1' + '">首页</a></li>';
                var html = "";
                var main = 0;
                $.each(result, function (a, b) {
                    html += '<li class="' + (($sub_area_id * 1 == a) ? 'current' : '') + '" id="' + a + '"><a href="' + tmp + ((b.suburl != '') ? b.suburl : b.url) + '?area=' + CustomEnCode(type) + '&submenu=' + b.itemid + '&id=' + a + '&top=' + CustomEnCode(b.menu) + '">' + b.menu + '</a></li>';
                    main++
                });
                html = html_home + html;
                $("#menuid").append(html);
                $("#menuid li").css("width", 1200 / (main + 1));

                var $menu_box = $('#menuid');
                $menu_box.on('mouseenter', 'li', function () {
                    $(this).attr('class', 'current');
                    $(this).siblings().attr('class', '')
                });
                $menu_box.mouseleave(function () {
                    $menu_box.find('li').attr('class', '');
                    if (!isNaN($sub_area_id * 1)) {
                        document.getElementById($sub_area_id).setAttribute('class', 'current')
                    } else {
                        document.getElementById('-1').setAttribute('class', 'current')
                    }
                });
            }
        })
    });
</script>